import React, { Component } from 'react';
import PropTypes from 'prop-types'
import {connect} from 'react-redux'

// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
import InputLabel from "@material-ui/core/InputLabel";
import Button from "@material-ui/core/Button";
// core components
import GridItem from "./GridItem.jsx";
import GridContainer from "./GridContainer.jsx";
import CustomInput from "./CustomInput.jsx";
import Card from "./Card.js";
import CardHeader from "./CardHeader.jsx";
import CardBody from "./CardBody.jsx";
import CardFooter from "./CardFooter.jsx";

import { fetchRegisterPost } from '../actions/Posts';
class RegisterPost extends Component{
  state = {
    posts:[],
  }

  handleRegister = (title,body,author,category) => () =>{
    this.props.dispatch(fetchRegisterPost(title,body,author,category))
  };

  render (){
     return(<div>

  <div id="register" class="col s12">
    <form class="col s12">
      <div class="form-container">
        <h3 class="teal-text">Welcome</h3>
        <div class="row">
          <div class="input-field col s6">
            <input id="last_name" type="text" class="validate"/>
            <label for="last_name">First Name</label>
          </div>
          <div class="input-field col s6">
            <input id="last_name" type="text" class="validate"/>
            <label for="last_name">Last Name</label>
          </div>
        </div>
        <div class="row">
          <div class="input-field col s12">
            <input id="email" type="email" class="validate"/>
            <label for="email">Email</label>
          </div>
        </div>
        <div class="row">
          <div class="input-field col s12">
            <input id="email-confirm" type="email" class="validate"/>
            <label for="email-confirm">Email Confirmation</label>
          </div>
        </div>
        <div class="row">
          <div class="input-field col s12">
            <input id="password" type="password" class="validate"/>
            <label for="password">Password</label>
          </div>
        </div>
        <div class="row">
          <div class="input-field col s12">
            <input id="password-confirm" type="password" class="validate"/>
            <label for="password-confirm">Password Confirmation</label>
          </div>
        </div>
        <center>
          <button class="btn waves-effect waves-light teal" type="submit" name="action">Submit</button>
        </center>
      </div>
    </form>
  </div>

      <Button onClick={this.handleRegister('a','b','c','react')}>
        Post
      </Button>
      </div>
    )
  }
}
export default connect ()(RegisterPost)
